import React from 'react';
import Input from '../../components/Input/Input';

const Form = () => {
  return (
    <div>
      {/* Input for created_by */}
      <Input placeholder="Created By" inputId="createdByInput" type="text" />

      {/* Input for dead_line */}
      <Input placeholder="Deadline" inputId="deadlineInput" type="date" />

      {/* Radio buttons for progress */}
      <div>
        <label>
          <input type="radio" name="progress" value="finished" /> Finished
        </label>
        <label>
          <input type="radio" name="progress" value="ongoing" /> On Going
        </label>
        <label>
          <input type="radio" name="progress" value="goodToGo" /> Good to Go
        </label>
      </div>

      {/* Input for description */}
      <textarea placeholder="Description" id="descriptionInput" rows="4" cols="50"></textarea>
    </div>
  );
};

export default Form;
